import React, { Component } from "react";
import MyTabNav from "../components/MyTabNav";


class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="container" aria-label="noteApp">
        <MyTabNav />
      </div>
    );
  }
}

export default App;
